class NavbarComponent extends React.Component{

  componentDidMount(){
    console.log(this.props.user)
  }

  render(){
    return(
      <div>Hi</div>
    )
  }
}

const mapStateToProps = (state, props) => ({
  user: state.user.user
});

export default withRouter(
  connect(
    mapStateToProps,
null
  )(NavbarComponent)
